package javaBasics1Practice;

public class Swap {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 10;
		int b = 20;
		int temp;
		temp = a;
		a = b;
		b = temp;
		System.out.println("The swap value of a is: " +a);
		System.out.println("The swap value of b is: " +b);
	}

}
